attrs.description:
Предлагаю как полный дизайн проект Вашей квартиры, дома и любого не жилого помещения, так и отдельные услуги: 
-3D визуализация 
-разработка рабочих чертежей 
- Перепланировка; 
- Планировочные решения; 
- Декорирование; 
- Подбор материалов и мебели; 
- Авторский надзор; 
- Стилистические решения; 
- Проектирование отдельных помещений без общей перепланировки.

В стоимость услуги входит:
- предпроектный анализ объекта - нужен для выявления потенциала Вашей квартиры;
- черновые варианты (без ограничений, до нужного результата) - нужны для наглядности возможных вариантов и возможности выбора;
- детальная разработка одного выбранного варианта;
- консультирование - после завершения работы могут возникать самые разные и неожиданные вопросы. Готова оказать поддержку:)

В итоге Вы получаете:
Один лист чертежа в формате PDF. Указываются размеры мебели, проходов, перечень мебели.

С данным чертежом Вы можете:
- обратиться в БТИ или за полным техническим проектом перепланировки;
- иметь четкое представление о габаритах покупаемой мебели и оборудования; 
- иметь представление о возможных вариация перестановки мебели
и функциональных зон (если, например, спустя время родится ребенок);
- это необходимый минимум для взаимодействия с ремонтной бригадой;
- продолжить разрабатывать частичный или полный дизайн-проект. 

Если требуются дополнительные чертежи, готова разработать. Цена договорная.

Стоимость 30 000 в месяц

Доведем до результата ваш объект, соединим дизайн проект с реальностью

- Регулярные выезды автора проекта на объект (до 2-х раз в неделю);
- Контроль соответствия проводимых работ дизайн – проекту;
- Необходимое общение с прорабом на объекте, в т.ч. и по телефону
(консультации по всем предоставленным чертежам);

Звоните, чтобы узнать подробности!

personalInfo.description:
Услуги по ремонту квартир под ключ от компании "Надёжный ремонт" - качество, проверенное временем, отделка и ремонт квартир любой сложности.
Выезд на замер бесплатный.

Наши услуги:
- ремонт квартир под ключ с материалами, дизайн интерьера дома;
- дизайн интерьера квартиры в современном стиле, дизайн офиса, дизайн квартиры студии, кафе хайтек, салона красоты в стиле лофт;
- качественный ремонт квартир в новостройке под ключ;
- ремонт коттеджей под ключ (по дизайн проекту коттеджа), ремонт таунхаусов;
- капитальный ремонт в квартире под ключ, капитальный ремонт дома;
- дизайн проект однокомнатной квартиры, ремонт трехкомнатной квартиры и ремонт двухкомнатной квартиры под ключ (любой дизайнерский ремонт квартир);
- ремонт новых квартир под ключ, ремонт в новостройке под ключ;
- текущий и капитальный ремонт офисов под ключ, отделка офисов в современном стиле;
- перепланировка квартиры, ремонт в сталинке или хрущевке, перепланировка нежилого помещения, перепланировка и переустройство жилого помещения;
- евроремонт квартир под ключ, внутренняя отделка, элитный ремонт квартир;
- предчистовая, чистовая и черновая отделка квартир, косметический ремонт;
- ремонт офисных помещений, ремонт коммерческих помещений, ремонт офиса под ключ.

Осуществляем ремонт квартир под ключ в Москве, Санкт-Петербурге, Ленинградской и Московской области. Чтобы заказать ремонт квартиры под ключ, звоните по телефону! Поможем сделать ремонт в квартире.
